import React from "react";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import Slider from "react-slick";

const Courses = () => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 3,
    slidesToScroll: 3
  };
  const arr =[1,2,3,4,5]
  return (
    <div>
      <div>
        <h2> Multiple items </h2>
        <Slider {...settings}>
          {arr.map((a, p) => {
            return (
              <div key={p}>X</div>
            )
          })}
        </Slider>
      </div>
    </div>
  );
};

export default Courses;
